import Navbar from '../pages/Navbar'
import Body_home from '../pages/Body_home'

export class Accueil extends Component {
  render() {
    return (
      <>
      <div>
        <Navbar />
        
      </div>
      <Body_home />
      </>
    )
  }
}

export default Accueil
